const pokemonsListReducer = (state, action) => {
  switch (action.type) {
    case "LOWER_OFFSET": {
      console.log("...state", state);
      return [...state, {}];
    }

    case "RAISE_OFFSET": {
      console.log("...state", state);
      return console.log("10", action.state);
    }

    case "LIMIT": {
      return console.log("14", action.state);
    }

    default:
      return state;
  }
};

export default pokemonsListReducer;
